message:
Update index.html

Old code snippet:

const directLine = window.WebChat.createDirectLine({ token, 
                                                               Domain: 'https://europe.directline.botframework.com/'});

New code snippet (generated by Copilot):

fetch('https://europe.directline.botframework.com/v3/directline/tokens/generate', {
    method: 'POST',
    headers: {
        'Authorization': `Bearer YOUR_DIRECT_LINE_SECRET`
    }
})
.then(response => response.json())
.then(data => {
    const token = data.token;
    const directLine = window.WebChat.createDirectLine({
        token: token,
        domain: 'https://europe.directline.botframework.com/v3/directline'
    });

    window.WebChat.renderWebChat({
        directLine: directLine
    }, document.getElementById('webchat'));
});
